script: |
  super -f text -I q9994.spq | sort > q9994.out

inputs:
  - name: q9994.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN cor0.col1 * col1 * + col1 AND ( - col0 * - col0 ) OR NOT ( + col1 + + cor0.col1 - - col2 ) NOT IN ( + cor0.col2 );
  - name: tab2

outputs:
  - name: q9994.out
    data: |
